issue.body:
When I try to use curried `transform` + `first` + `property`, it will throws error

```
version: 3.7.0(my own package) and 3.9.0(in the website)
```

Error:

```
Uncaught TypeError: Cannot read property 'thru' of undefined
    at Function.<anonymous> (https://lodash.com/_js/lodash.js:3325:94)
    at <anonymous>:2:21
    at Object.InjectedScript._evaluateOn (<anonymous>:895:140)
    at Object.InjectedScript._evaluateAndWrap (<anonymous>:828:34)
    at Object.InjectedScript.evaluate (<anonymous>:694:21)
```

Example Code:

```js
var camelize = _.curry(_.transform, 2)(_, function(result, val, key) {
  result[_.camelCase(key)] = val;
});

var getFirstRecordAndTransform = _.compose(camelize,  _.first, _.property('rows'));  // in this step will throws error

getFirstRecordAndTransform({
  rows: [
    {
       foo_bar: 'baz'
    }
  ]
});
```

But it's fine when I try:

```js
var getFirstRecordAndTransform = _.compose(_.first, _.property('rows')); 
```

